import React from 'react'
import DashboardFooter from '../../components/dashboard/DashboardFooter'
import DashboardNavbar from './DashboardNavbar'

const DProducts = () => {
  return (
    <>
    <DashboardNavbar/>
    <div>DProducts</div>
    <DashboardFooter/>
    </>
  )
}

export default DProducts;
